import React from "react";
import pizzaHurt from '../components/PizzaHurt';

let pizza = () =>{
    return(
        <React.Fragment>
            <p className="pizza">Pizza</p>
            <p className="lead">this is new pizza in store </p>
            <img src="https://images.lifestyleasia.com/wp-content/uploads/sites/7/2022/11/23161734/Best-pizza-in-Bangalore-2.jpg?tr=w-1200,h-900" alt="image-fluid"/>
            
        </React.Fragment>
    )
}
export default pizzaHurt;
